import React from 'react';
import './App.css';
import { Switch, Route} from 'react-router-dom';
import HomePage from "./components/pages/homepage/HomePage";

const HatsPage =() => (
  <div>
    <h1>hats and caps</h1>
  </div>
)

function App() {
  return (
    <div>
      <Switch>
      <Route path='hats' component={HatsPage} />
        <Route exact path="/" component={HomePage} />
      </Switch>
    </div>
  );
}

export default App;
